import React from "react";
import NavBar from "../../components/NavBar/NavBar";
import image from '../../components/assets/photo2.jpg'

import Carousel from 'react-multi-carousel';
//import 'react-multi-carousel/lib/styles.css';

const responsive = {
  superLargeDesktop: {
    // the naming can be any, depends on you.
    breakpoint: { max: 4000, min: 3000 },
    items: 5
  },
  desktop: {
    breakpoint: { max: 3000, min: 1024 },
    items: 3
  },
  tablet: {
    breakpoint: { max: 1024, min: 464 },
    items: 2
  },
  mobile: {
    breakpoint: { max: 464, min: 0 },
    items: 1
  }
};

function AboutMeView() {
  return (
    <>
      <div className="aboutMe__container">
        <div className="aboutMe__container--navbar">
          <NavBar text1="Powrót" text2="Galeria" text3="Kontakt" />
        </div>
        <div className="aboutMe__container--container">
          <div>
          <span>
            Cześć! Jestem Natalia, kocham psy a moją równie wielką pasją jest
            fotografia. Postanowiłam połączyć te dwa "światy" i zająć się
            fotografią naszych czwronożnych przyjaciół. Zapraszam Cię zatem do
            mojego pieskiego świata! Gwarantuję, że znajdziesz tu mnóstwo kadrów
            pełnych psich emocji. Skąd moja pasja do psiej
            fotografii ? Na pewno to duża zasługa mojej już 9-letniej
            labradorki, którą uwielbiam fotografować i której mam niezliczoną
            ilość zdjęć w swoich albumach 🙂 Robiłam zdjęcia dla frajdy, dla
            siebie, wtedy psia fotografia nie była tym czym chciałabym się zająć
            na większą skalę. Kiedy natomiast, pojawił się pomysł by
            fotografować psy ze schroniska i w ten sposób pomogłam wielu psiakom
            znaleźć nowy dom, dało mi to motywację do działania. Poczułam, że
            fotografia psów sprawia mi ogromną radość i satysfakcję. Zaczęłam
            robić zdjęcia znajomym z ich pupilami, a to jaką ilość endorfin
            fundowały mi sesje piesko-ludzkie coraz bardziej przekonywały mnie
            by rozwijać się w kierunku fotografii psów. Kilka dni temu
            ukończyłam warsztaty z psiej fotografii, które dodatkowo dały mi
            dużego kopa do działania z Waszymi pupilami 🙂 Tak właściwie
            pomyślałam.. To prosta historia jak zaczęła się moja przygoda z psią
            fotografią ale czy proste historie nie są najlepsze ? 🙂 Zapraszam
            Cię zatem do mojego pieskiego świata! 🙂 Głęboko wierzę, że Ciebie i
            Twojego pupila łączy wyjątkowa i silna więź. Postaram się o to, aby
            została ona odzwierciedlona na zrobionych przeze mnie zdjęciach 🙂
          </span> 
          </div>
          <div>
          <Carousel responsive={responsive}>
  <div>Item 1</div>
  <div>Item 2</div>
  <div>Item 3</div>
  <div>Item 4</div>
</Carousel>
          </div>
        </div>
      </div>
    </>
  );
}

export default AboutMeView;
